<script>
import Api from '@/utils/api/traffic';
import { mapState } from 'vuex';
export default {
  data: () => ({
    flow: {
      YES1: '#000000',
      YES2: '#000000',
      YES3: '#000000',
      YES4: '#000000',
      YES5: '#000000',
      YES6: '#000000',
      YES7: '#000000',
      YES8: '#000000',
      YES9: '#000000',
      YES10: '#000000',
      YES11: '#000000',
      YES12: '#000000',
      YES13: '#000000',
      NO1: '#000000',
      NO2: '#000000',
      NO3: '#000000',
      NO4: '#000000',
      NO5: '#000000',
      NO6: '#000000',
      NO7: '#000000',
      NO8: '#000000',
      NO9: '#000000',
      NO10: '#000000',
      NO11: '#000000',
      NO12: '#000000',
      NO13: '#000000',
      num1: { fill: '#FFFFFF', stroke: '#000000', color: '#000000' },
      num2: { fill: '#FFFFFF', stroke: '#000000', color: '#000000' },
      num3: { fill: '#FFFFFF', stroke: '#000000', color: '#000000' },
      num4: { fill: '#FFFFFF', stroke: '#000000', color: '#000000' },
      num5: { fill: '#FFFFFF', stroke: '#000000', color: '#000000' },
      VL1: 0,
      VL2: 0,
      VL3: 0,
      VL4: 0,
      VL5: 0,
      VL6: 0,
      VL7: 0,
      VL8: 0,
      VL9: 0,
      VL10: 0,
      VL11: 0,
      VL12: 0,
      VL13: 0
    }
  }),

  computed: {
    ...mapState('traffic', ['currentFlowChartParams'])
  },

  watch: {
    currentFlowChartParams() {
      this.update();
    }
  },

  mounted() {
    this.update();
  },

  methods: {
    async update() {
      if (this.currentFlowChartParams) {
        const i = this.currentFlowChartParams;
        const params = await this.fetchParameters(i.deviceId, i.direction, i.time);
        Object.assign(params, i);
        this.updateFlowChart(params, i.status);
      }
    },

    async fetchParameters(deviceId, direction, time) {
      let result = null;
      try {
        const response = await Api.fetchMdistParameters(deviceId, direction, time);
        if (response.data.status === 'OK') {
          if (response.data.data !== undefined) {
            const data = response.data.data;
            if (Object.keys(data).length > 0) {
              result = data;
            }
          }
        } else {
          this.$store.dispatch('traffic/setSystemStatus', { text: response.data.message, color: 'error' });
        }
      } catch (error) {
        this.$store.dispatch('traffic/setSystemStatus', { text: error, color: 'error' });
      }

      return result;
    },

    updateFlowChart(params, status) {
      const values = this.setValues(params);
      const codes = this.setStatusCode(status);
      Object.assign(this.flow, values, codes);
    },

    setValues(params) {
      return {
        VL1: params.speed,
        VL2: params.volume,
        VL3: params.occupancy,
        VL4: this.round(params.sC),
        VL5: this.round(params.vC),
        VL6: this.round(params.oC),
        VL7: this.round(params.mdist),
        VL8: this.round(params.mH),
        VL9: this.round(params.mCutoff),
        VL10: this.round(params.vHQ),
        VL11: this.round(params.vLQ),
        VL12: this.round(params.oH),
        VL13: this.round(params.oL)
      };
    },

    setStatusCode(code) {
      const result = {
        YES1: '#000000',
        YES2: '#000000',
        YES3: '#000000',
        YES4: '#000000',
        YES5: '#000000',
        YES6: '#000000',
        YES7: '#000000',
        YES8: '#000000',
        YES9: '#000000',
        YES10: '#000000',
        YES11: '#000000',
        YES12: '#000000',
        YES13: '#000000',
        NO1: '#000000',
        NO2: '#000000',
        NO3: '#000000',
        NO4: '#000000',
        NO5: '#000000',
        NO6: '#000000',
        NO7: '#000000',
        NO8: '#000000',
        NO9: '#000000',
        NO10: '#000000',
        NO11: '#000000',
        NO12: '#000000',
        NO13: '#000000',
        num1: { fill: '#FFFFFF', stroke: '#000000', color: '#000000' },
        num2: { fill: '#FFFFFF', stroke: '#000000', color: '#000000' },
        num3: { fill: '#FFFFFF', stroke: '#000000', color: '#000000' },
        num4: { fill: '#FFFFFF', stroke: '#000000', color: '#000000' },
        num5: { fill: '#FFFFFF', stroke: '#000000', color: '#000000' }
      };

      switch (code) {
        case 1:
          result.YES1 = '#FF0000';
          result.YES2 = '#FF0000';
          result.YES3 = '#FF0000';
          result.num1 = { fill: '#FFFF00', stroke: '#FF0000', color: '#FF3333' };
          break;
        case 2:
          result.YES1 = '#FF0000';
          result.YES2 = '#FF0000';
          result.NO4 = '#FF0000';
          result.YES5 = '#FF0000';
          result.num2 = { fill: '#FFFF00', stroke: '#FF0000', color: '#FF3333' };
          break;
        case 3:
          result.YES1 = '#FF0000';
          result.NO3 = '#FF0000';
          result.YES4 = '#FF0000';
          result.YES5 = '#FF0000';
          result.num3 = { fill: '#FFFF00', stroke: '#FF0000', color: '#FF3333' };
          break;
        case 4:
          result.NO1 = '#FF0000';
          result.YES6 = '#FF0000';
          result.YES7 = '#FF0000';
          result.YES8 = '#FF0000';
          result.YES9 = '#FF0000';
          result.num4 = { fill: '#FFFF00', stroke: '#FF0000', color: '#FF3333' };
          break;
        case 5:
          result.NO1 = '#FF0000';
          result.NO2 = '#FF0000';
          result.YES10 = '#FF0000';
          result.YES11 = '#FF0000';
          result.YES12 = '#FF0000';
          result.YES13 = '#FF0000';
          result.num5 = { fill: '#FFFF00', stroke: '#FF0000', color: '#FF3333' };
          break;
        case -1:
          result.YES1 = '#FF0000';
          result.YES2 = '#FF0000';
          result.NO4 = '#FF0000';
          result.NO6 = '#FF0000';
          break;
        case -2:
          result.YES1 = '#FF0000';
          result.NO3 = '#FF0000';
          result.YES4 = '#FF0000';
          result.NO6 = '#FF0000';
          break;
        case -3:
          result.YES1 = '#FF0000';
          result.NO3 = '#FF0000';
          result.NO5 = '#FF0000';
          break;
        case -4:
          result.NO1 = '#FF0000';
          result.YES6 = '#FF0000';
          result.YES7 = '#FF0000';
          result.YES8 = '#FF0000';
          result.NO9 = '#FF0000';
          break;
        case -5:
          result.NO1 = '#FF0000';
          result.YES6 = '#FF0000';
          result.YES7 = '#FF0000';
          result.NO8 = '#FF0000';
          break;
        case -6:
          result.NO1 = '#FF0000';
          result.YES6 = '#FF0000';
          result.NO7 = '#FF0000';
          break;
        case -7:
          result.NO1 = '#FF0000';
          result.NO2 = '#FF0000';
          result.YES10 = '#FF0000';
          result.YES11 = '#FF0000';
          result.YES12 = '#FF0000';
          result.NO13 = '#FF0000';
          break;
        case -8:
          result.NO1 = '#FF0000';
          result.NO2 = '#FF0000';
          result.YES10 = '#FF0000';
          result.YES11 = '#FF0000';
          result.NO12 = '#FF0000';
          break;
        case -9:
          result.NO1 = '#FF0000';
          result.NO2 = '#FF0000';
          result.YES10 = '#FF0000';
          result.NO11 = '#FF0000';
          break;
        case -10:
          result.NO1 = '#FF0000';
          result.NO2 = '#FF0000';
          result.NO10 = '#FF0000';
          break;
      }
      return result;
    },

    round(num) {
      return Math.round((num + Number.EPSILON) * 100) / 100;
    }
  }
};
</script>

